import React from 'react';

const Listbox = props => {

    
    return (
        <section className="collum">
            <div className="list-group">
                {
                    props.items.map((item, idx) => 
                    <div key={idx}
                        
                        className="content__tarck"
                        id={item.track.id}>
                            <img id="img__tarck" src={item.track.album.images[0].url}/>
                            <div className="name">{item.track.name}</div>
                    </div>)
                }
            </div>
        </section>
        

    );
}

export default Listbox;
